import React from 'react';

const Alert = ({ alert }) => {
  return (
    alert && alert.message && (
      <div className={`alert alert-${alert.type} alert-dismissible fade show`} role="alert">
        <strong>{alert.type === 'success' ? 'Success:' : 'Note:'} </strong> {alert.message}
      </div>
    )
  );
};

export default Alert;
